import{_ as e,c as o,o as a,a4 as t}from"./chunks/framework.uQk9_EO2.js";const i="/docs/cocos/assets/project-build-menu.B494Me6i.png",r="/docs/cocos/assets/ios-build-panel.LzkcHPEN.png",s="/docs/cocos/assets/ios-build-open-path.DwWb5xJU.png",n="/docs/cocos/assets/ios-xcode-folder.Cmk05GB0.png",c="/docs/cocos/assets/ios-xcode-showcase.CXHSUOua.png",l="/docs/cocos/assets/ios-run.BD4o9Xje.png",_=JSON.parse('{"title":"iOS Publishing Example","description":"","frontmatter":{},"headers":[],"relativePath":"en/editor/publish/ios/build-example-ios.md","filePath":"en/editor/publish/ios/build-example-ios.md","lastUpdated":1712305443000}'),d={name:"en/editor/publish/ios/build-example-ios.md"},p=t('<h1 id="ios-publishing-example" tabindex="-1">iOS Publishing Example <a class="header-anchor" href="#ios-publishing-example" aria-label="Permalink to &quot;iOS Publishing Example&quot;">​</a></h1><p>This article will demonstrate the process of publishing a Cocos Creator project as an iOS application. Before getting started, you will need the following preparations:</p><ul><li>A macOS device with Xcode installed</li><li>An Apple Developer account</li></ul><h2 id="publishing-process" tabindex="-1">Publishing Process <a class="header-anchor" href="#publishing-process" aria-label="Permalink to &quot;Publishing Process&quot;">​</a></h2><h3 id="register-an-apple-developer-account" tabindex="-1">Register an Apple Developer account <a class="header-anchor" href="#register-an-apple-developer-account" aria-label="Permalink to &quot;Register an Apple Developer account&quot;">​</a></h3><p>Firstly, you need to have an Apple Developer account. If you don&#39;t have one, please go to the <a href="https://appleid.apple.com/account" target="_blank" rel="noreferrer">registration page</a> to create an account.</p><h3 id="verify-the-macos-system-and-xcode-version" tabindex="-1">Verify the macOS System and Xcode Version <a class="header-anchor" href="#verify-the-macos-system-and-xcode-version" aria-label="Permalink to &quot;Verify the macOS System and Xcode Version&quot;">​</a></h3><p>Publishing iOS apps via Cocos Creator environment requirements:</p><ul><li>Xcode version <strong>11.5</strong> or above.</li><li>macOS version <strong>10.14</strong> or above.</li></ul><blockquote><p><strong>Note</strong>: By default, the corresponding Xcode version in the App Store matches the system. If you want to use a specific version of Xcode, you can download it from the <a href="https://developer.apple.com/xcode/download/" target="_blank" rel="noreferrer">Xcode download page</a>.</p></blockquote><h3 id="prepare-a-test-project" tabindex="-1">Prepare a Test Project <a class="header-anchor" href="#prepare-a-test-project" aria-label="Permalink to &quot;Prepare a Test Project&quot;">​</a></h3><p>Open an existing project or create a new one.</p><h3 id="build" tabindex="-1">Build <a class="header-anchor" href="#build" aria-label="Permalink to &quot;Build&quot;">​</a></h3><p><img src="'+i+'" alt="project-build-menu"></p><p>As shown in the image above, select <strong>Project -&gt; Build</strong> from the top menu in Cocos Creator to open the build panel.</p><p><img src="'+r+'" alt="ios-build-panel"></p><h4 id="general-options" tabindex="-1">General Options <a class="header-anchor" href="#general-options" aria-label="Permalink to &quot;General Options&quot;">​</a></h4><p>In the blue section on the left side of the image, you can find the common parameters that need to be configured for all platforms supported by Cocos Creator. For more details, you can refer to the <a href="./../build-options">General Build Options</a> page.</p><h4 id="ios-specific-options" tabindex="-1">iOS Specific Options <a class="header-anchor" href="#ios-specific-options" aria-label="Permalink to &quot;iOS Specific Options&quot;">​</a></h4><p>Choose the platform as <strong>iOS</strong>, and as you scroll down the panel, you will see the red section on the right side. These are the configurations specific to the <code>native</code> and <code>iOS</code> platforms. For more details, please refer to the <a href="./../native-options">General Native Build Options</a> and <a href="./build-options-ios">Build Options - iOS</a> pages.</p><h4 id="bundle-identifier" tabindex="-1">Bundle Identifier <a class="header-anchor" href="#bundle-identifier" aria-label="Permalink to &quot;Bundle Identifier&quot;">​</a></h4><p>The Bundle Identifier is a required configuration. It is generally in the format of <code>com.mycompany.myproduct</code>. For example, in this example, it is set to <code>com.cocos.testios</code>.</p><h4 id="perform-the-build" tabindex="-1">Perform the Build <a class="header-anchor" href="#perform-the-build" aria-label="Permalink to &quot;Perform the Build&quot;">​</a></h4><p>After completing the configurations, click the <strong>Build</strong> button to generate the Xcode project.</p><p>Once the build is successful, you can click the open file button as shown below to open the generated project folder.</p><p><img src="'+s+'" alt="ios-build-open-path"></p><p>If you haven&#39;t changed the build path, you can find the <code>build/ios/proj</code> directory in the project root, which contains the following files:</p><p><img src="'+n+'" alt="ios-xcode-folder"></p><h3 id="compile-and-run-in-xcode" tabindex="-1">Compile and Run in Xcode <a class="header-anchor" href="#compile-and-run-in-xcode" aria-label="Permalink to &quot;Compile and Run in Xcode&quot;">​</a></h3><p>Double-click on <code>build/ios/proj/&lt;project_name&gt;.xcodeproj</code> to open the Xcode project.</p><p><img src="'+c+'" alt="ios-xcode-showcase"></p><p>Select <code>&lt;ProjectName&gt;-mobile</code> as the build target, choose a suitable simulator or a connected iOS device, and click the compile and run button to start the project.</p><p><img src="'+l+'" alt="ios-run"></p><h2 id="read-more" tabindex="-1">Read More <a class="header-anchor" href="#read-more" aria-label="Permalink to &quot;Read More&quot;">​</a></h2><h3 id="script-native-communication" tabindex="-1">Script-Native Communication <a class="header-anchor" href="#script-native-communication" aria-label="Permalink to &quot;Script-Native Communication&quot;">​</a></h3><p>Sometimes, projects need to call iOS system functions from the script layer, or when integrating a third-party iOS SDK, it is necessary to call its API through script code. In such cases, the communication mechanism between the script layer and the native layer is required.</p><p>For communication mechanisms, please refer to:</p><ul><li><a href="./../../../advanced-topics/oc-reflection">JavaScript and iOS/macOS Communication with Reflection</a></li><li><a href="./../../../advanced-topics/js-oc-bridge">JavaScript and Objective-C Communication using JsbBridge</a></li></ul><h3 id="debugging-javascript-on-native-platforms" tabindex="-1">Debugging JavaScript on Native Platforms <a class="header-anchor" href="#debugging-javascript-on-native-platforms" aria-label="Permalink to &quot;Debugging JavaScript on Native Platforms&quot;">​</a></h3><p>Some issues only occur on specific devices and environments. If you can debug the code on the corresponding situation, you can quickly identify the problem and find a solution.</p><p>Cocos Creator provides a native debugging mechanism that allows you to easily debug game code on a device. For more details, please refer to <a href="./../debug-jsb">Debugging JavaScript on Native Platforms</a>.</p><h2 id="features-and-system-versions" tabindex="-1">Features and System Versions <a class="header-anchor" href="#features-and-system-versions" aria-label="Permalink to &quot;Features and System Versions&quot;">​</a></h2><p>Different features rely on specific system versions. Please refer to <a href="./../../../advanced-topics/supported-versions">Features and System Versions</a> for more details.</p>',43),h=[p];function u(m,f,b,g,v,y){return a(),o("div",null,h)}const x=e(d,[["render",u]]);export{_ as __pageData,x as default};
